import { Route, Routes } from 'react-router-dom';
import React from 'react';
import Auth from './Pages/Auth';

import './scss/app.scss'

const App: React.FC = () => {
  return (
    <Routes>
        <Route path='/' element={<Auth/>}/>
    </Routes>
  );
};

export default App;
